```

**src/main.rs**
```rust
use reqwest;
use serde::{Deserialize, Serialize};
use serde_json;
use tokio;
use clipboard;
use tts;

#[derive(Deserialize, Serialize)]
struct ElevenLabsResponse {
    audio_url: String,
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn std::error::Error>> {
    // Set up elevenlabs.io API credentials
    let api_key = "YOUR_API_KEY_HERE";
    let api_secret = "YOUR_API_SECRET_HERE";

    // Get the contents of the clipboard
    let clipboard_contents = clipboard::get_clipboard_contents().unwrap();

    // Create a request to the elevenlabs.io API
    let client = reqwest::Client::new();
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech")
        .header("Authorization", format!("Bearer {}", api_key))
        .header("Content-Type", "application/json")
        .body(serde_json::to_string(& ElevenLabsRequest {
            text: clipboard_contents,
            voice: "en-US".to_string(),
            speed: 1.0,
        })?)
        .send()
        .await?;

    // Check if the response was successful
    if response.status().is_success() {
        // Get the audio URL from the response
        let response: ElevenLabsResponse = serde_json::from_str(&response.text().await?)?;
        let audio_url = response.audio_url;

        // Play the audio using TTS
        tts::play_audio(audio_url).await?;
    } else {
        eprintln!("Error: {}", response.status());
    }

    Ok(())
}

struct ElevenLabsRequest {
    text: String,
    voice: String,
    speed: f64,
}
```

