Here are a few popular compiler optimization techniques, along with example codes and explanations:

**1. Dead Code Elimination**

Dead code elimination is a technique where the compiler removes code that does not affect the program's output. This can include unreachable code, unused variables, and functions that are never called.

Example:
```c
int foo() {
    int x = 5;
    return x;
    printf("This code is never reached\n"); // dead code
}
```
In this example, the `printf` statement is never executed because it is after the `return` statement. The compiler can eliminate this code, resulting in:
```c
int foo() {
    int x = 5;
    return x;
}
```
Benefits: Reduced code size, improved performance.

**2. Constant Folding**

Constant folding is a technique where the compiler evaluates constant expressions at compile-time, rather than at runtime.

Example:
```c
